//The code that is fired upon page load
console.log('notification listener content page loaded');

var observe = false;
var elSelector = 'body';
var pageUrl = window.location.toString();

chrome.storage.sync.get({
    sites: '',
    elementSelector: "body"
}, function(items) {

    if (items.sites !== "") {
        var pages = items.sites.split(" ");

        pages.forEach(function(item, index) {
            console.log(item, index);
            if (item !== "") {
                let itemStr = item.toLowerCase().trim();
                if (pageUrl.toLowerCase().indexOf(itemStr) >= 0) {
                    observe = true;
                    console.log('page matches ' + pageUrl + " entry " + itemStr);
                } else {
                    console.log('page DO NOT matches ' + pageUrl + " entry " + itemStr);
                }
            }
        });



    }

    if (items.elementSelector !== "") {
        elSelector = items.elementSelector;
    }

    if (observe) {
        startMonitoring();
    }


});

var lastExecution = new Date();
var ONE_SECOND = 1 * 1000;




function beep() {
    var snd = new Audio("data:audio/wav;base64,");

    if (new Date() - lastExecution > ONE_SECOND) {

        lastExecution = new Date();
        snd.play();
    } else {
        console.log('sound already playing...');
    }

}

function showMessage(msg, url) {
    var notify = new Notification(msg);
}

function notifyMe(msg, url) {
    if (!window.Notification) {
        console.log('Browser does not support notifications.');
    } else {
        // check if permission is already granted
        if (Notification.permission === 'granted') {
            showMessage(msg, url);
        } else {
            // request permission from user
            Notification.requestPermission().then(function(p) {
                if (p === 'granted') {
                    showMessage(msg, url);
                } else {
                    console.log('User blocked notifications.');
                }
            }).catch(function(err) {
                console.error(err);
            });
        }
    }
}

var observeDOM = (function() {
    var MutationObserver = window.MutationObserver || window.WebKitMutationObserver;

    return function(obj, callback) {
        if (!obj || !obj.nodeType === 1) return; // validation

        if (MutationObserver) {
            // define a new observer
            var obs = new MutationObserver(function(mutations, observer) {
                callback(mutations);
            })
            // have the observer observe foo for changes in children
            obs.observe(obj, {
                childList: true,
                subtree: true
            });
        } else if (window.addEventListener) {
            obj.addEventListener('DOMNodeInserted', callback, false);
            obj.addEventListener('DOMNodeRemoved', callback, false);
        }
    }
})();


function startMonitoring() {

    var elem = document.querySelector(elSelector)


    // Observe a specific DOM element:
    observeDOM(elem, function(m) {
        var addedNodes = [],
            removedNodes = [];

        m.forEach(record => record.addedNodes.length & addedNodes.push(...record.addedNodes))

        m.forEach(record => record.removedNodes.length & removedNodes.push(...record.removedNodes))


        console.log('Added:', addedNodes, 'Removed:', removedNodes);
        // var tabURL = window.location.href;
        // var queryString = window.location.search;
        let page = window.location.toString();
        console.log('change on page ' + page)
        notifyMe(page, page)
        beep();
    });

}


chrome.runtime.onMessage.addListener(function(request, sender, sendResponse) {
    console.log('message event received ' + request.args);
});